import React, { Fragment } from 'react';
import Navbar from './components/layout/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <Router>
      <Fragment>
        <Navbar />
        <div class='Container'>
          <Switch></Switch>
        </div>
      </Fragment>
    </Router>
  );
};

export default App;
